import React from 'react';
import "../../Images/not found img.jpg"
const NotFound = () => {
    return (
        <div>
            <h1>not found</h1>
            <img src="require('../../Images/not found img.jpg')" alt="" />
        </div>
    );
};

export default NotFound;
